import React, { useContext } from "react";
import { Link } from "react-router-dom";
import { UserContext } from "../../UserContext";
import Roomlist from "./Roomlist";
const Home = () => {
  const { user, setUser } = useContext(UserContext);
  const rooms = [
    {
      name: "room1",
      _id: "132",
    },
    {
      name: "rome2",
      _id: "323",
    },
  ];
  const setjohn = () => {
    const john = {
      name: "john",
      email: "john@gmail.com",
      password: "123",
      _id: "345",
    };
    setUser(john);
    console.log(user);
  };
  const setTom = () => {
    const tom = {
      name: "tom",
      email: "tom@gmail.com",
      password: "456",
      _id: "468",
    };
    setUser(tom);
  };
  return (
    <div>
      <div className="row">
        <div className="col s12 m6">
          <div className="card blue-grey darken-1">
            <div className="card-content white-text">
              <span className="card-title">Welcome {user ? user.name : ""}</span>
            </div>
            <div className="row">
              <div className="input-field col s6">
                <input
                  value=""
                  placeholder="Enter Room Name"
                  id="room"
                  type="text"
                  className="validate"
                />
                <label className="active" for="first_name2">
                  Room Name
                </label>
              </div>
            </div>
            <a className="waves-effect waves-light btn">Create Room</a>
            <div className="card-action">
              <button onClick={setjohn}>Set as john</button>
              <button onClick={setTom}>Set as tom</button>
            </div>
          </div>
        </div>
       <Roomlist rooms={rooms}/>
      </div>
      <Link to="/chat">
        <button>Goto chat</button>
      </Link>
    </div>
  );
};

export default Home;
